<html lang="en">
<head>

    <title>Valentine's Proposal</title>
    <style>
        body {
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            background-color: pink;
            flex-direction: column;
            font-family: Arial, sans-serif;
            text-align: center;
            overflow: hidden;
            position: relative;
            color: white; /* Set all text to white */
        }
        h1 {
            color: white; /* Set the question text color to white */
            font-size: 32px;
            font-weight: bold;
        }
        .buttons {
            margin-top: 20px;
            display: flex;
            gap: 50px;
            position: relative;
        }
        button {
            font-size: 20px;
            padding: 10px 20px;
            border: none;
            cursor: pointer;
            border-radius: 10px;
            position: relative;
            color: white; /* Set button text color to white */
        }
        #yes {
            background-color: red;
        }
        #no {
            background-color: gray;
            position: absolute;
        }
        .hidden {
            display: none;
        }
        .celebrate {
            position: fixed;
            top: 0;
            left: 0;
            width: 100vw;
            height: 100vh;
            background: pink;
            font-size: 40px;
            color: white; /* Set final message text color to white */
            display: flex;
            align-items: center;
            justify-content: center;
            flex-direction: column;
            font-weight: bold;
        }
    </style>
</head>

            let newX = Math.min(window.innerWidth - 150, Math.max(0, currentLeft + deltaX));
            let newY = Math.min(window.innerHeight - 100, Math.max(0, currentTop + deltaY));
            noButton.style.position = "absolute";
            noButton.style.left = `${newX}px`;
            noButton.style.top = `${newY}px`;
        }
